sql:
SELECT c.customer_id, c.name, SUM(o.total_amount) as total_revenue 
                FROM customers c JOIN orders o ON c.customer_id = o.customer_id 
                GROUP BY c.customer_id, c.name ORDER BY total_revenue DESC LIMIT 10;

